import React, { createContext } from "react";
import ComC from "./ComC";

export const Context = createContext();

const App = () => {
  return (
    <div>
      <Context.Provider value={"ParentValue"}>
        <ComC />
      </Context.Provider>
    </div>
  );
};

export default App;
